import { LoginContext } from "../context/LoginContext";

const Home = () => {
  let { user, dispatch } = useContext(LoginContext);
  console.log(user);
  return (
    <div>
      {user &&
        user.map((item) => {
          return <h1>item.name</h1>;
        })}
    </div>
  );
};

export default Home;
